import React, { Component } from "react";
import test from "../images/pizza_image";
import ("../pages/main.css");




class Main extends Component {
    render(){
        return(
            
            <div className="container">
            <div className="bg-image">
           
<div className="bg-image img1"><img src={test} alt="bullshit"/></div>
<div className="bg-image img2"></div>
<div className="bg-image img3"></div>
<div className="bg-image img4"></div>
<div className="bg-image img5"></div>
<div className="bg-image img6"></div>
<div className="bg-text">Snap It!</div>

</div>
            
            </div>
        )
    }
}

export default Main;
